import FAQ from "./pages/faq";
import Footer from "./"
import './App.css';

function App() {
  return (
    <div className="App">
      <Landing/>
      <About/>
      <Venue/>
      <Contact/>
      <FAQ/>
    </div>
  );
}

export default App;
